import { HOME_COMPONENTS } from './data/input';
import Search from './components/Search/Search';
import HomeCards from './components/HomeCard/HomeCard';
import './App.css';

function App() {
  const renderCards = () => {
    // HOME_COMPONENTS.map(({ heading, text, buttonCta }) => {
    //   return <HomeCards heading={heading} text={text} buttonCta={buttonCta} />;
    // });
    return (
      <HomeCards heading='Test' text='Another test' buttonCta='Get started' />
    );
  };

  return (
    <div className='App'>
      <Search />
      {renderCards()}
    </div>
  );
}

export default App;
